CKEDITOR.plugins.setLang("a11yhelp","sv",{title:"Hj\xe4lpmedelsinstruktioner",contents:"Hj\xe4lpinneh\xe5ll. F\xf6r att st\xe4nga denna dialogruta trycker du p\xe5 ESC.",legend:[{name:"Allm\xe4nt",items:[{name:"Editor verktygsf\xe4lt",legend:"Tryck p\xe5 ${toolbarFocus} f\xf6r att navigera till verktygsf\xe4ltet. Flytta till n\xe4sta och f\xf6reg\xe5ende verktygsf\xe4ltsgrupp med TAB och SHIFT-TAB. Flytta till n\xe4sta och f\xf6reg\xe5ende knapp i verktygsf\xe4ltet med H\xd6GERPIL eller V\xc4NSTERPIL. Tryck Space eller ENTER f\xf6r att aktivera knappen i verktygsf\xe4ltet."},{name:"Dialogeditor",legend:"Inuti en dialogruta, tryck TAB f\xf6r att navigera till n\xe4sta f\xe4lt i dialogrutan. Du trycker SKIFT + TAB f\xf6r att flytta till f\xf6reg\xe5ende f\xe4lt. Tryck ENTER f\xf6r att skicka. Du avbryter och st\xe4nger dialogen med ESC. F\xf6r dialogrutor som har flera flikar, tryck ALT + F10 navigera till fliklistan. Flytta sedan till n\xe4sta flik med H\xd6GERPIL. Flytta till f\xf6reg\xe5ende flik med SHIFT + TAB eller V\xc4NSTERPIL. Tryck Space eller ENTER f\xf6r att v\xe4lja fliken."},{name:"Editor f\xf6r inneh\xe5llsmeny",legend:"Tryck p\xe5 $ {contextMenu} eller PROGRAMTANGENTEN f\xf6r att \xf6ppna snabbmenyn. Flytta sedan till n\xe4sta menyalternativ med TAB eller NEDPIL. Flytta till f\xf6reg\xe5ende alternativ med SHIFT + TABB eller UPPIL. Tryck Space eller ENTER f\xf6r att v\xe4lja menyalternativ. \xd6ppna undermeny av nuvarande alternativ med SPACE eller ENTER eller H\xd6GERPIL. G\xe5 tillbaka till \xf6verordnade menyalternativ med ESC eller V\xc4NSTERPIL. St\xe4ng snabbmenyn med ESC."},{name:"Editor f\xf6r List Box",legend:"Inuti en list-box, g\xe5 till n\xe4sta listobjekt med TAB eller NEDPIL. Flytta till f\xf6reg\xe5ende listobjekt med SHIFT + TAB eller UPPIL. Tryck Space eller ENTER f\xf6r att v\xe4lja listan alternativet. Tryck ESC f\xf6r att st\xe4nga listan-boxen."},{name:"Editor f\xf6r elementens s\xf6kv\xe4g",legend:"Tryck p\xe5 $ {elementsPathFocus} f\xf6r att navigera till verktygsf\xe4ltet f\xf6r elementens s\xf6kv\xe4gar. Flytta till n\xe4sta elementknapp med TAB eller H\xd6GERPIL. Flytta till f\xf6reg\xe5ende knapp med SKIFT + TAB eller V\xc4NSTERPIL. Tryck Space eller ENTER f\xf6r att v\xe4lja element i redigeraren."}]},{name:"Kommandon",items:[{name:"Kommandot \xe5ngra",legend:"Tryck p\xe5 ${undo}"},{name:"Kommandot g\xf6r om",legend:"Tryck p\xe5 ${redo}"},{name:"Kommandot fet stil",legend:"Tryck p\xe5 ${bold}"},{name:"Kommandot kursiv",legend:"Tryck p\xe5 ${italic}"},{name:"Kommandot understruken",legend:"Tryck p\xe5 ${underline}"},{name:"kommandot l\xe4nk",legend:"Tryck p\xe5 ${link}"},{name:"Verktygsf\xe4lt D\xf6lj kommandot",legend:"Tryck p\xe5 ${toolbarCollapse}"},{name:"G\xe5 till f\xf6reg\xe5ende fokus plats",legend:"Tryck p\xe5 ${accessPreviousSpace} f\xf6r att g\xe5 till n\xe4rmast on\xe5bara utrymme f\xf6re mark\xf6ren, exempel: tv\xe5 intilliggande HR element. Repetera tangentkombinationen f\xf6r att g\xe5 till n\xe4sta."},{name:"Tillg\xe5 n\xe4sta fokuskommandots utrymme",legend:"Tryck ${accessNextSpace} p\xe5 f\xf6r att komma \xe5t den n\xe4rmaste on\xe5bar fokus utrymme efter cirkumflex, till exempel: tv\xe5 intilliggande HR element. Upprepa tangentkombinationen f\xf6r att n\xe5 avl\xe4gsna fokus utrymmen."},{name:"Hj\xe4lp om tillg\xe4nglighet",legend:"Tryck ${a11yHelp}"}]}]});